(1, 60, 'Duis sed odio sit amet nibh vulputate cursus', 'java-article-1', '<h3><strong><img src="images/joomlavi/blog1.jpg" alt="" width="744" height="302" /></strong></h3>\r\n<p>Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. Duis sed odio sit amet nibh vulputate cursus a sit amet mauris. Morbi accumsan ipsum velit. Nam nec tellus a odio tincidunt auctor a ornare odio. Sed non mauris vitae erat consequat auctor eu in elit. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos.</p>\r\n', '\r\n<p> </p>\r\n<h3><strong>Objectives:</strong></h3>\r\n<ul>\r\n<li>How to add a navigation drawer to you app?</li>\r\n<li>How to populate the drawer list?</li>\r\n<li>How to open the drawer by clicking on the app icon “top-left icon”?</li>\r\n<li>How to handle click events?</li>\r\n</ul>', 1, 8, '2014-05-22 16:00:56', 262, '', '2014-05-23 04:13:32', 262, 0, '0000-00-00 00:00:00', '2014-05-22 16:00:56', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 5, 5, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 61, 'Android article one', 'android-article-one', '<p><strong>Android article one:</strong></p>\r\n<p>Android volley is a networking library was introduced to make networking calls much easier, faster without writing tons of code. By default all the volley network calls works asynchronously, so we don’t have to worry about using asynctask anymore.</p>\r\n<p>Volley comes with lot of features. Some of them are</p>\r\n<p>1. Request queuing and prioritization<br /> 2. Effective request cache and memory management<br /> 3. Extensibility and customization of the library to our needs</p>', '', 1, 9, '2014-05-22 16:02:38', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:02:38', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 15, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(3, 62, 'Cordova Article 1', 'cordova-article-1', '<p><strong>Cordova Article 1:</strong></p>\r\n<p>Before developing for any of the platforms listed below, install cordova''s command-line interface (CLI). (For details, see <a href="http://cordova.apache.org/docs/en/3.4.0/guide_cli_index.md.html#The%20Command-Line%20Interface">The Command-Line Interface</a>.)</p>\r\n<p>To develop Cordova applications, you must install SDKs for each mobile platform you are targeting. This installation is necessary regardless of whether you do the majority of your work in the SDK or use the CLI for your build cycle.</p>\r\n<p>Each <em>Platform Guide</em> listed below tells you what you need to know to set up each platform''s development environment: where to obtain the SDK, how to set up device emulators, how to connect devices for direct testing, and how to manage signing key requirements. Additional guides provide information on each platform''s unique set of configuration options, instructions to add plugins, how to upgrade each platform, and platform-specific command-line tools that serve as a lower-level alternative to the <code>cordova</code> command-line utility.</p>', '', 1, 10, '2014-05-22 16:04:04', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:04:04', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 7, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(4, 63, 'Phone Article 1', 'phone-article-1', '<p><strong>Phone Article 1:</strong></p>\r\n<p>Easily create apps using the web technologies you know and love: HTML, CSS and JavaScript</p>\r\n<p>PhoneGap is a free and open source framework that allows you to create mobile apps using standardized web APIs for the platforms you care about.</p>\r\n<p>From first-timers to long-time veterans, we’ve got your dev needs covered. The developer portal is the place to find guides, documentation and tutorials.</p>', '', 1, 11, '2014-05-22 16:06:47', 262, '', '2014-06-05 09:58:49', 262, 262, '2014-06-05 09:58:49', '2014-05-22 16:06:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"0","show_print_icon":"0","show_email_icon":"0","show_vote":"0","show_hits":"0","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, '', '', 1, 8, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 64, 'Setup environment work of Sencha Touch 2.3.1', 'setup-environment-work-of-sencha-touch', '<h2 id="getting_started-section-required-software">Required Software</h2>\r\n<ol>\r\n<li>Download and unzip <a href="http://www.sencha.com/products/touch/download">Sencha Touch</a>. You can unzip the software to any directory.</li>\r\n<li>Sencha Touch requires <a href="http://www.google.com/chrome">Chrome</a> or <a href="http://www.apple.com/safari">Safari</a> for good view</li>\r\n<li><a href="http://www.sencha.com/products/sencha-cmd/download">Sencha Cmd</a>.<br /> Sencha Touch 2.3.1 requires Sencha Cmd 4.0.1, 4.0.2, or later. To check that you have correctly installed Sencha Cmd, type the sencha command, for example:\r\n<pre><em>sencha</em></pre>\r\n', '\r\n<pre id="ext-gen1453"> </pre>\r\n</li>\r\n<li><a href="http://www.oracle.com/technetwork/java/javase/downloads/jre7-downloads-1880261.html">Java Runtime Environment</a> version 1.7. Sencha Cmd is written in Java and needs the JRE to run. <strong>Note</strong>: If you are building an Android app using Windows, you must install the <a href="http://www.oracle.com/technetwork/java/javase/downloads/jdk7-downloads-1880260.html">Java SDK</a>. You can build an iOS app under Windows with the JRE, but not an Android app</li>\r\n<li><a href="http://www.ruby-lang.org/en/downloads/">Ruby</a> to create the compiled CSS used by Touch.<br /> <br /> <strong>Windows </strong>=&gt; Download Ruby from <a href="http://rubyinstaller.org/downloads/">rubyinstaller.org</a>. Download the RubyInstaller .exe file and run it.</li>\r\n</ol>\r\n<h2 id="getting_started-section-installation">Installation</h2>\r\n<p>Extract the Sencha Touch download zip file, which can be in any directory.</p>\r\n<p>Start your web server such as <a href="http://www.apachefriends.org/en/xampp.html">XAMPP</a> , create an app directory where your web server expects to find apps ( &lt;XAMPP_install_dir&gt;/htdocs directory )</p>\r\n<h2 id="getting_started-section-generating-your-first-app">Generating Your First App</h2>\r\n<p>Now that you have Sencha Touch and Sencha Cmd installed, you can generate an application.</p>\r\n<p>With Window, Open cmd and run command:</p>\r\n<pre id="ext-gen1454"><em>sencha -sdk /path/to/touch generate app NameApp /path/to/myapp  </em></pre>\r\n<p>Where:</p>\r\n<ol>\r\n<li><em>/path/to/touch</em> is the directory where you unzipped the Touch software.</li>\r\n<li><em>NameApp </em>is the name you give your application.</li>\r\n</ol>\r\n<p>You can verify if your application has generated successfully by opening it in a web browser , navigate to http://localhost/<em>NameApp</em></p>\r\n<p><strong>Note</strong>: This is guide for Sencha touch 2.3.1 on window and XAMPP server</p>\r\n<h2 id="getting_started-section-explore-the-code">Explore the Code</h2>\r\n<p>The following listing provides a short description of each file and directory, the complete list of the generated files can be found in the <a href="http://docs.sencha.com/touch/2.3.1/#%21/guide/command">Sencha Cmd</a> documentation:</p>\r\n<ul>\r\n<li><strong>app</strong> - The directory containing the Models, Views, Controllers, and Stores for your app.</li>\r\n<li><strong>app.js</strong> - The main JavaScript entry point for your app.</li>\r\n<li><strong>app.json</strong> - The configuration file for your app.</li>\r\n<li><strong>index.html</strong> - The HTML file for your app.</li>\r\n<li><strong>packager.json</strong> - The configuration file used by Sencha Cmd for creating native packages for your application.</li>\r\n<li><strong>resources</strong> - The directory containing the CSS and the images for your app</li>\r\n</ul>\r\n<p>Open app.js, the main entry point for your app, in your editor.The <em>launch</em> function is the entry point to your application.</p>\r\n<p><strong> For more detail when build basic apps with sencha touch, please read following link </strong></p>\r\n<p><a href="http://docs.sencha.com/touch/2.3.1/#!/guide/first_app" target="_blank">http://docs.sencha.com/touch/2.3.1/#!/guide/first_app</a></p>\r\n<p> </p>', 1, 12, '2014-05-02 16:08:00', 262, '', '2014-06-04 03:35:57', 262, 262, '2014-06-04 03:35:57', '2014-06-02 16:08:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 14, 0, '', '', 1, 19, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 65, 'PHP article 1', 'php-article-1', '<p> </p>\r\n<p><strong>PHP Development article 1:</strong></p>\r\n<p>The PHP development team announces the immediate availability of PHP 5.6.0beta3. As we entered the feature freeze with beta1, this is is a bugfix-only release. All users of PHP are encouraged to test this version carefully, and report any bugs in <a href="https://bugs.php.net">the bug tracking system</a>.</p>\r\n<p><strong>THIS IS A DEVELOPMENT PREVIEW - DO NOT USE IT IN PRODUCTION!</strong></p>\r\n<p>For more information about the new features you can check out the work-in-progress <a href="http://docs.php.net/manual/en/migration56.new-features.php">documentation</a> or you can read the full list of changes in the <a href="https://github.com/php/php-src/blob/php-5.6.0beta3/NEWS">NEWS file</a> contained in the release archive.</p>', '', 1, 13, '2014-05-22 16:10:17', 262, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-05-22 16:10:17', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, '', '', 1, 20, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
