(47, 5, 1, '', '2014-06-03 04:52:39', 262, 4472, '700c589f43e747d8286437cd38ac5ecbee786aa7', '{"id":5,"asset_id":"64","title":"Setup environment work of Sencha Touch 2.3.1","alias":"sencha-article-1","introtext":"<h2 id=\\"getting_started-section-required-software\\">Required Software<\\/h2>\\r\\n<ol>\\r\\n<li>Download and unzip <a href=\\"http:\\/\\/www.sencha.com\\/products\\/touch\\/download\\">Sencha Touch<\\/a>. You can unzip the software to any directory.<\\/li>\\r\\n<li>Sencha Touch requires <a href=\\"http:\\/\\/www.google.com\\/chrome\\">Chrome<\\/a> or <a href=\\"http:\\/\\/www.apple.com\\/safari\\">Safari<\\/a> for good view<\\/li>\\r\\n<li><a href=\\"http:\\/\\/www.sencha.com\\/products\\/sencha-cmd\\/download\\">Sencha Cmd<\\/a>.<br \\/> Sencha Touch 2.3.1 requires Sencha Cmd 4.0.1, 4.0.2, or later. To check that you have correctly installed Sencha Cmd, type the sencha command, for example:\\r\\n<pre id=\\"ext-gen1453\\"><em>sencha<\\/em><\\/pre>\\r\\n<\\/li>\\r\\n<li><a href=\\"http:\\/\\/www.oracle.com\\/technetwork\\/java\\/javase\\/downloads\\/jre7-downloads-1880261.html\\">Java Runtime Environment<\\/a> version 1.7. Sencha Cmd is written in Java and needs the JRE to run. <strong>Note<\\/strong>: If you are building an Android app using Windows, you must install the <a href=\\"http:\\/\\/www.oracle.com\\/technetwork\\/java\\/javase\\/downloads\\/jdk7-downloads-1880260.html\\">Java SDK<\\/a>. You can build an iOS app under Windows with the JRE, but not an Android app<\\/li>\\r\\n<li><a href=\\"http:\\/\\/www.ruby-lang.org\\/en\\/downloads\\/\\">Ruby<\\/a> to create the compiled CSS used by Touch.<br \\/> <br \\/> <strong>Windows <\\/strong>=&gt; Download Ruby from <a href=\\"http:\\/\\/rubyinstaller.org\\/downloads\\/\\">rubyinstaller.org<\\/a>. Download the RubyInstaller .exe file and run it.<\\/li>\\r\\n<\\/ol>\\r\\n<h2 id=\\"getting_started-section-installation\\">Installation<\\/h2>\\r\\n<p>Extract the Sencha Touch download zip file, which can be in any directory.<\\/p>\\r\\n<p>Start your web server such as <a href=\\"http:\\/\\/www.apachefriends.org\\/en\\/xampp.html\\">XAMPP<\\/a> , create an app directory where your web server expects to find apps ( &lt;XAMPP_install_dir&gt;\\/htdocs directory )<\\/p>\\r\\n<h2 id=\\"getting_started-section-generating-your-first-app\\">Generating Your First App<\\/h2>\\r\\n<p>Now that you have Sencha Touch and Sencha Cmd installed, you can generate an application.<\\/p>\\r\\n<p>With Window, Open cmd and run command:<\\/p>\\r\\n<pre id=\\"ext-gen1454\\"><em>sencha -sdk \\/path\\/to\\/touch generate app NameApp \\/path\\/to\\/myapp  <\\/em><\\/pre>\\r\\n<p>Where:<\\/p>\\r\\n<ol>\\r\\n<li><em>\\/path\\/to\\/touch<\\/em> is the directory where you unzipped the Touch software.<\\/li>\\r\\n<li><em>NameApp <\\/em>is the name you give your application.<\\/li>\\r\\n<\\/ol>\\r\\n<p>You can verify if your application has generated successfully by opening it in a web browser , navigate to http:\\/\\/localhost\\/<em>NameApp<\\/em><\\/p>\\r\\n<p><strong>Note<\\/strong>: This is guide for Sencha touch 2.3.1 on window and XAMPP server<\\/p>","fulltext":"","state":1,"catid":"12","created":"2014-05-22 16:08:03","created_by":"262","created_by_alias":"","modified":"2014-06-03 04:52:39","modified_by":"262","checked_out":"262","checked_out_time":"2014-06-03 04:49:55","publish_up":"2014-05-22 16:08:03","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_posi