zip file, which can be in any directory.<\\/p>\\r\\n<p>Start your web server such as <a href=\\"http:\\/\\/www.apachefriends.org\\/en\\/xampp.html\\">XAMPP<\\/a> , create an app directory where your web server expects to find apps ( &lt;XAMPP_install_dir&gt;\\/htdocs directory )<\\/p>\\r\\n<h2 id=\\"getting_started-section-generating-your-first-app\\">Generating Your First App<\\/h2>\\r\\n<p>Now that you have Sencha Touch and Sencha Cmd installed, you can generate an application.<\\/p>\\r\\n<p>With Window, Open cmd and run command:<\\/p>\\r\\n<pre id=\\"ext-gen1454\\"><em>sencha -sdk \\/path\\/to\\/touch generate app NameApp \\/path\\/to\\/myapp  <\\/em><\\/pre>\\r\\n<p>Where:<\\/p>\\r\\n<ol>\\r\\n<li><em>\\/path\\/to\\/touch<\\/em> is the directory where you unzipped the Touch software.<\\/li>\\r\\n<li><em>NameApp <\\/em>is the name you give your application.<\\/li>\\r\\n<\\/ol>\\r\\n<p>You can verify if your application has generated successfully by opening it in a web browser , navigate to http:\\/\\/localhost\\/<em>NameApp<\\/em><\\/p>\\r\\n<p><strong>Note<\\/strong>: This is guide for Sencha touch 2.3.1 on window and XAMPP server<\\/p>\\r\\n<h2 id=\\"getting_started-section-explore-the-code\\">Explore the Code<\\/h2>\\r\\n<p>The following listing provides a short description of each file and directory, the complete list of the generated files can be found in the <a href=\\"http:\\/\\/docs.sencha.com\\/touch\\/2.3.1\\/#%21\\/guide\\/command\\">Sencha Cmd<\\/a> documentation:<\\/p>\\r\\n<ul>\\r\\n<li><strong>app<\\/strong> - The directory containing the Models, Views, Controllers, and Stores for your app.<\\/li>\\r\\n<li><strong>app.js<\\/strong> - The main JavaScript entry point for your app.<\\/li>\\r\\n<li><strong>app.json<\\/strong> - The configuration file for your app.<\\/li>\\r\\n<li><strong>index.html<\\/strong> - The HTML file for your app.<\\/li>\\r\\n<li><strong>packager.json<\\/strong> - The configuration file used by Sencha Cmd for creating native packages for your application.<\\/li>\\r\\n<li><strong>resources<\\/strong> - The directory containing the CSS and the images for your app<\\/li>\\r\\n<\\/ul>\\r\\n<p>Open app.js, the main entry point for your app, in your editor.The <em>launch<\\/em> function is the entry point to your application.<\\/p>\\r\\n<p><strong>\\u00a0For more detail when build basic apps with sencha touch, please read following link\\u00a0<\\/strong><\\/p>\\r\\n<p><a href=\\"http:\\/\\/docs.sencha.com\\/touch\\/2.3.1\\/#!\\/guide\\/first_app\\" target=\\"_blank\\">http:\\/\\/docs.sencha.com\\/touch\\/2.3.1\\/#!\\/guide\\/first_app<\\/a><\\/p>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"12","created":"2014-05-02 16:08:00","created_by":"262","created_by_alias":"","modified":"2014-06-04 03:33:14","modified_by":"262","checked_out":"262","checked_out_time":"2014-06-04 03:32:48","publish_up":"2014-06-02 16:08:00","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":12,"ordering":"0","metakey":"","metadesc":"","access":"1","hits":"10","metadata":"{\\"robots\\":\\"\\",\\"author\\":\\"\\",\\"rights\\":\\"\\",\\"xreference\\":\\"\\"}","featured":"0","language":"*","xreference":""}', 0),
